import React from "react";
import { Button, UncontrolledPopover, PopoverHeader, PopoverBody, Table } from 'reactstrap';
import './Styles.css';

function Nav_bar() {
    return (
        <nav class="navbar navbar-dark bg-dark">
            <div class="mx-auto order-0">
                <text class="navbar-brand ms-auto" href="#">Navbar</text>
                {/* <button class="navbar-toggler mr-auto" type="button" data-toggle="collapse" data-target=".dual-collapse2">
                    <span class="navbar-toggler-icon"></span>
                </button> */}
            </div>
            <div class="navbar-collapse collapse w-100 order-3 dual-collapse2">
            </div>
        </nav>



    );
}

export default Nav_bar
